import React from 'react';

export default function Navbar() {
    return (
        <nav className="bg-white shadow-md">
            <div className="container mx-auto px-4 py-3 flex justify-between items-center">
                <div className="flex items-center gap-2">
                    <img src="/logo_forjaF.png" alt="Logo" className="h-16 w-16" />
                    <span className="font-bold text-lg">Forja SA</span>
                </div>
                <ul className="flex gap-6 font-medium">
                    <li><a href="/" className="hover:text-blue-600 transition">Inicio</a></li>
                    <li><a href="/cursos" className="hover:text-blue-600 transition">Cursos</a></li>
                    <li><a href="/contacto" className="hover:text-blue-600 transition">Contacto</a></li>
                </ul>
            </div>
        </nav>
    );
}
